function App(){ //define a function 

  const getPic = () => {
    console.log("hello");
  }

  fetch(url)
    .then((res) => res.json())
    .then((cats) => {
      console.log('Cats: ', cats);
    })
    .catch((error) => {
      console.log('error', error);
  });

return(
  <div>
    <h1> Bilal's Cat App</h1>
